import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Footer extends Component {
    render() {
        return (
            <div className="container">
                <Link to=""><i className="socialMedia fas fa-facebook"></i></Link>
            </div>
        );
    }
}

export default Footer;
